UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:L', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-7</p><div class="cpg-header">Scope</div><p>Password protected IT and OT assets, where safe and technically capable</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">All unsuccessful logins are logged and sent to an organization''s security team or relevant logging system. Security teams are notified (e.g., by an alert) after a specific number of consecutive, unsuccessful login attempts in a short period (e.g., 5 failed attempts over 2 minutes). This alert is logged and stored in the relevant security or ticketing system for retroactive analysis. <br><br>For IT assets, there is a system-enforced policy that prevents future logins for the suspicious account. For example, this could be for some minimum time, or until the account is re-enabled by a privileged user.  This configuration is enabled when available on an asset. For example, Windows 11 can automatically lock out accounts for 10 minutes after 10 incorrect logins over a 10 minute period.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Brute Force - Password Guessing (T1110.001) </li><li>Brute Force - Password Cracking (T1110.002) </li><li>Brute Force - Password Spraying (T1110.003) </li><li>Brute Force - Credential Stuffing (T1110.004)</li></ul><p></p>', [Sequence]=12, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9880
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:F', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-1</p><div class="cpg-header">Scope</div><p>Password protected IT assets, and newly acquired OT assets.</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">An enforced organization-wide policy and/or process that requires changing default manufacturer passwords for any/all hardware, software, and firmware before being put on any internal or external network. This includes IT assets for OT, such as OT administration web pages. <br><br>In instances where changing default passwords is not feasible (e.g., a control system with a hard-coded password), implement and document appropriate compensating security controls, and monitor logs for network traffic and login attempts on those devices.<br><br>OT: While changing default passwords on an organization''s existing OT requires significantly more work, we still recommend having such a policy to change default credentials for all new or future devices. This is not only easier to achieve, but also reduces potential risk in the future if adversary TTPs change.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Valid Accounts - Default Accounts (T1078.001)</li><li>Valid Accounts (ICS T0859)</li></ul><p></p>', [Sequence]=6, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9881
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:M', [Question_Text]=N'<div class="cpg-header">Security Practice</div><p class="cpg-practice">Phishing Resistant Multi-Factor Authentication (MFA)</p><p></p><div class="cpg-header">Outcome</div><p class="cpg-outcome">Add a critical, additional layer of security to protect assets accounts whose credentials have been compromised.</p><p></p>', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-7</p><div class="cpg-header">Scope</div><p>IT assets, and  OT assets with remote access, such as workstations, and HMI''s, where safe and technically capable.</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Hardware-based MFA is enabled when available; if not, then soft tokens (such as via mobile app) should be used; MFA via SMS should only be used when no other options are possible.<br><br>IT: IT accounts leverage multi-factor authentication to access organizational resources.  <br><br>OT: Within OT environments, MFA is enabled on all accounts and systems that can be accessed remotely, including  vendors/maintenance accounts, remotely accessible user and engineering workstations, and remotely accessible Human Machine Interfaces (HMIs).</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Brute Force (T1110)</li><li>Remote Services - Remote Desktop Protocol (T1021.001)</li><li>Remote Services - SSH (T1021.004)</li><li>Valid Accounts (T1078, ICS T0859)</li><li>External Remote Services (ICS T0822)</li></ul><p></p>', [Sequence]=13, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9882
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:G', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-1</p><div class="cpg-header">Scope</div><p>Password protected IT and Windows-based OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations have a system-enforced policy that requires a minimum password length of 15* or more characters for all password protected IT assets, and all OT assets where technically possible.** Organizations should consider leveraging passphrases and password managers to make it easier for users to maintain sufficiently long passwords. In instances where minimum password lengths are not technically feasible, compensating controls are applied and recorded, and all login attempts to those assets are logged. Assets that cannot support passwords of sufficient strength length are prioritized for upgrade or replacement. <br><br>This goal is particularly important for organizations that lack widespread implementation of MFA and capabilities to protect against brute-force attacks (such as Web Application Firewalls and third-party Content Delivery Networks) or are unable to adopt passwordless authentication methods. <br><br>* Modern attacker tools can crack 8 character passwords quickly. Length is a more impactful and important factor in password strength than complexity or frequent password rotations, and makes it easier for humans to create and remember passwords. <br><br>** OT assets that use a central authentication mechanism (such as Active Directory) are most important to address. Examples of low-risk OT assets that may not be technically feasible include those in remote locations, such as those on offshore rigs or on top of wind turbines.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Brute Force - Password Guessing (T1110.001) </li><li>Brute Force - Password Cracking (T1110.002) </li><li>Brute Force - Password Spraying (T1110.003) </li><li>Brute Force - Credential Stuffing (T1110.004)</li></ul><p></p>', [Sequence]=7, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9883
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:J', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-4</p><div class="cpg-header">Scope</div><p>IT and OT assets, where safe and technically capable</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">No user accounts always have administrator or super-user privileges.  Administrators maintain separate user accounts for all actions and activities not associated with the administrator role (e.g. for business email, web browsing, etc.).  Privileges are  revaluated on a recurring basis to validate continued need for a given set of permissions.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Valid Accounts (T1078, ICS T0859)</p>', [Sequence]=10, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9884
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:H', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-1</p><div class="cpg-header">Scope</div><p>IT and OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations provision unique and separate credentials for similar services and asset access on  IT and OT networks.  Users do not (or cannot) reuse passwords for accounts, applications, services, etc.  Service accounts/machine accounts have unique passwords from all member user accounts.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Valid Accounts (T1078, ICS T0859)</li><li>Brute Force - Password Guessing (T1110.001)</li></ul><p></p>', [Sequence]=8, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9885
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:I', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-1</p><div class="cpg-header">Scope</div><p>Departing/Departed Employees</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">A defined and enforced administrative process applied to all departing employees by the day of their departure that (1) revokes and securely return all physical badges, key cards, tokens, etc., and (2) disables all user accounts and access to organizational resources.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Valid Accounts (T1078, ICS T0859)</p>', [Sequence]=9, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9886
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:Q', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.IP-3</p><div class="cpg-header">Scope</div><p>IT and OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Implement an administrative policy or automated process that requires approval before new hardware, firmware, or software/software version is installed or deployed. Organizations maintain a risk-informed allowlist of approved hardware, firmware, and software, to include specification of approved versions, when technically feasible.  For OT assets specifically, these actions should also be aligned with defined change control and testing activities.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Supply Chain Compromise (T1195, ICS T0862)</li><li>Hardware Additions (T1200)</li><li>Browser Extensions (T1176)</li><li>Transient Cyber Asset (ICS T0864)</li></ul><p></p>', [Sequence]=17 WHERE [Mat_Question_Id] = 9887
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:N', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.IP-1, PR.IP-3</p><div class="cpg-header">Scope</div><p>IT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">A system-enforced policy that disables Microsoft Office macros, or similar embedded code, by default on all devices. If macros must be enabled in specific circumstances, there is a policy for authorized users to request that macros are enabled on specific assets.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Phishing - Spearphishing Attachment (T1566.001)</li><li>User Execution - Malicious FIle (T1204.002)</li></ul><p></p>', [Sequence]=14 WHERE [Mat_Question_Id] = 9888
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:A', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.AM-1</p><div class="cpg-header">Scope</div><p>IT and OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Maintain a regularly updated inventory of all organizational assets with an IP address (including IPv6), including OT.  This inventory is updated on a recurring basis, no less than monthly for both IT and OT.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Hardware Additions (T1200)</li><li>Exploit Public-Facing Application (T0819, ICS T0819)</li><li>Internet Accessible Device (ICS T0883)</li></ul><p></p>', [Sequence]=1, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9889
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:V', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.PT-2</p><div class="cpg-header">Scope</div><p>IT and OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations maintain policies and processes to ensure that unauthorized media and hardware are not connected to IT and OT assets, such as by limiting use of USB devices and removable media or disabling AutoRun. <br><br>OT: When feasible, establish procedures to remove, disable, or otherwise secure physical ports to prevent the connection of unauthorized devices, or establish procedures for granting access through approved exceptions.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Hardware Additions (T1200)</li><li>Replication Through Removable Media (T1091, ICS T0847)</li></ul><p></p>', [Sequence]=22 WHERE [Mat_Question_Id] = 9890
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:O', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.IP-1</p><div class="cpg-header">Scope</div><p>IT and OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations maintain accurate documentation describing the baseline and current configuration details of all critical IT and OT assets, to facilitate more effective vulnerability management and response &amp; recovery activities. Periodic reviews and updates are performed and tracked on a recurring basis.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Delayed, insufficient, or incomplete ability to maintain or restore functionality of critical devices and service operations.</p>', [Sequence]=15 WHERE [Mat_Question_Id] = 9891
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:T', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.PT-1</p><div class="cpg-header">Scope</div><p>IT and OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Access and security focused (e.g., IDS/IDPS, firewall, DLP, VPN) logs are collected and stored for use in both detection and incident response activities (e.g. forensics). Security teams are notified when a critical log source is disabled, such as Windows Event Logging. <br> <br>OT: For OT assets where logs are non-standard or not available, network traffic and communications between those assets and other assets is collected.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Delayed, insufficient, or incomplete ability to detect and respond to potential cyber incidents. </li><li>Impair Defenses (T1562)</li></ul><p></p>', [Sequence]=20, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9892
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:U', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.PT-1</p><div class="cpg-header">Scope</div><p>IT and OT assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Logs are stored in a central system, such as a Security Information and Event Management (SIEM) tool or central database, and can only be accessed or modified by authorized and authenticated users. Logs are stored for a duration informed by risk or pertinent regulatory guidelines.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Indicator Removal on Host - Clear Windows Event Logs (T1070.001)</li><li>Indicator Removal on Host - Clear Linux or Mac System Logs (T1070.002)</li><li>Indicator Removal on Host - File Deletion (T1070.004)</li><li>Indicator Removal on Host (ICS T0872)</li></ul><p></p>', [Sequence]=21, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9893
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:C', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.DS-1, PR.DS-2</p><div class="cpg-header">Scope</div><p>All IT traffic and remote OT assets (those that communicate with external entities)</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Properly configured and up-to-date secure socket layer (SSL) / transport layer security (TLS) is utilized to protect data in transit where technically feasible.  Organizations should also plan for identifying any use of outdated or weak encryption and updating to sufficiently strong algorithms, and consideration for managing the implications of post-quantum cryptography. <br><br>OT: To minimize the impact to latency and availability; encryption is used where feasible, usually for OT communications connecting with remote/external assets.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Adversary-in-the-Middle (T1557)</li><li>Automated Collection (T1119)</li><li>Network Sniffing (T1040, ICS T0842)</li><li>Wireless Compromise (ICS T0860)</li><li>Wireless Sniffing (ICS T0887)</li></ul><p></p>', [Sequence]=3, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9894
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:D', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.DS-1, PR.DS-2, PR.DS-5</p><div class="cpg-header">Scope</div><p>All passwords, credentials, secrets, and other sensitive or controlled information</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Sensitive data, including credentials, are not stored in plaintext anywhere in the organization, and can only be accessed by authenticated and authorized users. Credentials are stored in a secure manner, such as with a credential/password manager or vault, or other privileged account management solution.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Unsecured Credentials (T1552)</li><li>Steal or Forge Kerberos Tickets (T1558)</li><li>OS Credential Dumping (T1003)</li><li>Data from Information Repositories (ICS T0811)</li><li>Theft of Operational Information (T0882)</li></ul><p></p>', [Sequence]=4, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9895
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:B', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.GV-1, ID.GV-2</p><div class="cpg-header">Scope</div><p>N/A</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">A named role/position/title is identified as responsible and accountable for planning, resourcing, and execution of cybersecurity activities.  This role may undertake activities such as managing cybersecurity operations at the senior level, requesting and securing budget resources, or leading strategy development to inform future positioning.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Lack of sufficient cybersecurity accountability, investment, or effectiveness.</p>', [Sequence]=2, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9896
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:C', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.GV1, ID.GV-2</p><div class="cpg-header">Scope</div><p>N/A</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">A named role/position/title is identified as responsible and accountable for planning, resourcing, and execution of OT-specific cybersecurity activities.  In some organizations this may be the same position as identified in 4.1.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Lack of accountability, investment, or effectiveness of OT cybersecurity program.</p>', [Sequence]=3, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9897
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:A', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AT-1</p><div class="cpg-header">Scope</div><p>All employees and contractors</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">At least annual trainings for all organizational employees and contractors that covers basic security concepts, such as phishing, business email compromise, basic operational security (OPSEC), password security, etc., as well as fostering an internal culture of security and cyber awareness.<br><br>New employees receive initial cybersecurity training within 10 days of onboarding, and recurring training on at least an annual basis.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">User Training (M1017, ICS M0917)</p>', [Sequence]=1, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9898
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:B', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AT-2, PR.AT-3, PR.AT-5</p><div class="cpg-header">Scope</div><p>All personnel responsible for OT security</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">In addition to basic cybersecurity training, personnel who maintain or secure OT as part of their regular duties receive OT-specific cybersecurity training on at least an annual basis.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">User Training (M1017, ICS M0917)</p>', [Sequence]=2, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9899
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:D', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.GV-2</p><div class="cpg-header">Scope</div><p>All IT and OT security personnel</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations sponsor at least one ''pizza party'' or equivalent social gathering per year that is focused on strengthening working relationships between IT and OT security personnel, and is not a working event (such as providing meals during an incident response).</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Poor working relationships and mutual understanding between IT and OT cybersecurity can often result in increased risk for OT cybersecurity.</p>', [Sequence]=4, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9900
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:E', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.IP-12, ID.RA-1, DE.CM-8, RS.MI-3</p><div class="cpg-header">Scope</div><p>Internet-facing assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">All known exploited vulnerabilities (listed in CISA''s KEV catalog - https://www.cisa.gov/known-exploited-vulnerabilities-catalog) in internet-facing systems are patched or otherwise mitigated within a risk-informed span of time, prioritizing more critical assets first.  <br><br>OT: For OT assets where patching is either not possible or may substantially compromise availability or safety, compensating controls are applied (e.g. segmentation, monitoring) and recorded. Sufficient controls should either make the asset inaccessible from the public internet, or reduce the ability of adversaries to exploit the vulnerabilities in these assets.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Active Scanning -  Vulnerability Scanning (T1595.002)</li><li>Exploit Public-Facing Application (T1190, ICS T0819)</li><li>Exploitation of Remote Service (T1210, ICS T0866)</li><li>Supply Chain Compromise (T1195, ICS T0862)</li><li>External Remote Services (T1133,  ICS T0822)</li></ul><p></p>', [Sequence]=5, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9901
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'4:A', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">RS.AN-5</p><div class="cpg-header">Scope</div><p>All assets</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Consistent with NIST SP 800-53 Revision 5, organizations maintain a public, easily-discoverable method for security researchers to notify (e.g. via email address or web form) organizations'' security teams of vulnerable, mis-configured, or otherwise exploitable assets. Valid submissions are acknowledged and responded to in a timely manner, taking into account the completeness and complexity of the vulnerability.  Validated and exploitable weaknesses are mitigated consistent with their severity.<br><br>Security researchers sharing vulnerabilities discovered in good faith are protected under Safe Harbor rules.<br><br>In instances where vulnerabilities are validated and disclosed, public acknowledgement is given to the researcher who originally submitted the notification.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Active Scanning -  Vulnerability Scanning (T1595.002)</li><li>Exploit Public-Facing Application (T1190, ICS T0819)</li><li>Exploitation of Remote Service (T1210, ICS T0866)</li><li>Supply Chain Compromise (T1195, ICS T0862)</li></ul><p></p>', [Sequence]=1, [Grouping_Id]=203 WHERE [Mat_Question_Id] = 9902
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'4:B', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">RS.AN-5</p><div class="cpg-header">Scope</div><p>All public-facing web domains.</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">All public-facing web domain have a security.txt file that conforms to the recommendations in RFC 9116.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Active Scanning -  Vulnerability Scanning (T1595.002)</li><li>Exploit Public-Facing Application (T1190, ICS T0819)</li><li>Exploitation of Remote Service (T1210, ICS T0866)</li><li>Supply Chain Compromise (T1195, ICS T0862)</li></ul><p></p>', [Sequence]=2, [Grouping_Id]=203 WHERE [Mat_Question_Id] = 9903
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:W', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.PT-4</p><div class="cpg-header">Scope</div><p>IT and OT assets on the public internet</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Assets on the public internet expose no exploitable services, such as RDP. Where these services must be exposed, appropriate compensating controls are implemented to prevent common forms of abuse and exploitation. All unnecessary OS applications and network protocols are be disabled on internet-facing assets.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Active Scanning -  Vulnerability Scanning (T1595.002)</li><li>Exploit Public-Facing Application (T1190, ICS T0819)</li><li>Exploitation of Remote Service (T1210, ICS T0866)</li><li>External Remote Services (T1133,  ICS T0822)</li><li>Remote Services - Remote Desktop Protocol (T1021.001)</li></ul><p></p>', [Sequence]=23, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9904
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:X', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.PT-4</p><div class="cpg-header">Scope</div><p>OT assets on the public internet</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">No OT assets are on the public internet, unless explicitly required for operation. Exceptions must be justified and documented, and excepted assets must have additional protections in place to prevent and detect exploitation attempts (such as logging, MFA, mandatory access via proxy or other intermediary, etc.) .</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Active Scanning -  Vulnerability Scanning (T1595.002)</li><li>Exploit Public-Facing Application (T1190, ICS T0819)</li><li>Exploitation of Remote Service (T1210, ICS T0866)</li><li>External Remote Services (T1133,  ICS T0822)</li></ul><p></p>', [Sequence]=24, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9905
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:F', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.RA-1, ID.RA-3</p><div class="cpg-header">Scope</div><p>IT and OT assets and networks</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Third-parties with demonstrated expertise in (IT and/or OT) cybersecurity regularly validate the effectiveness and coverage of an organization''s cybersecurity defenses.  These exercises, which may include penetration tests, bug bounties, incident simulations, or table-top exercises, should include both unannounced and announced tests.<br><br>Exercises consider both the ability and impact of a potential adversary to infiltrate the network from the outside, as well as the ability of an adversary within the network (e.g., &#8220;assume breach&#8221;) to pivot laterally to demonstrate potential impact on critical (including OT/ICS) systems.<br><br>High-impact findings from previous tests are mitigated in a timely manner and are not re-observed in future tests.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Reduce risk of gaps in cyber defenses or a false sense of security in existing protections.</p>', [Sequence]=6, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9906
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:I', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.SC-3</p><div class="cpg-header">Scope</div><p>Suppliers of IT and OT assets and services</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations'' procurement documents include cybersecurity requirements and questions, which are evaluated in vendor selection such that, given two offerings of roughly similar cost and function, the more secure offering and/or supplier is preferred.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Supply Chain Compromise (T1195, ICS T0862)</p>', [Sequence]=9, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9907
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:G', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.SC-1, ID.SC-3</p><div class="cpg-header">Scope</div><p>Suppliers of IT and OT assets and services</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Procurement documents and contracts, such as Service Level Agreements (SLAs), stipulate that vendors and/or service providers notify the procuring customer of security incidents within a risk-informed timeframe as determined by the organization.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Supply Chain Compromise (T1195, ICS T0862)</p>', [Sequence]=7, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9908
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'1:H', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.SC-1, ID.SC-3</p><div class="cpg-header">Scope</div><p>Suppliers of IT and OT assets and services</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Procurement documents and contracts, such as Service Level Agreements (SLAs), stipulate that vendors and/or service providers notify the procuring customer of confirmed security vulnerabilities in their assets within a risk-informed timeframe as determined by the organization.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Supply Chain Compromise (T1195, ICS T0862)</p>', [Sequence]=8, [Grouping_Id]=200 WHERE [Mat_Question_Id] = 9909
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'4:C', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">RS.CO-2, RS.CO-4</p><div class="cpg-header">Scope</div><p>Organization-wide</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations maintain codified policy and procedures on to whom and how to report all confirmed cybersecurity incidents to appropriate external entities (e.g. state/federal regulators or SRMA''s as required, ISAC/ISAO, as well as CISA).<br><br>Known incidents are reported to CISA as well as other necessary parties within timeframes directed by applicable regulatory guidance or in the absence of guidance, as soon as safely capable. This goal will be revisited following full implementation of the Cyber Incident Reporting for Critical Infrastructure Act of 2022 (CIRCIA)</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Without timely incident reporting, CISA and other groups are less able to assist affected organizations, and lack critical information into the broader threat landscape (such as whether a broader attack is occurring against a specific sector).</p>', [Sequence]=3, [Grouping_Id]=203 WHERE [Mat_Question_Id] = 9910
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:S', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.IP-9, PR.IP-10</p><div class="cpg-header">Scope</div><p>Organization-wide</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations have, maintain, updated, and regularly drill IT and OT cybersecurity incident response plans for both common and organizationally-specific (e.g. by sector, locality, etc.) threat scenarios and TTPs. When conducted, tests or drills are as realistic in nature as feasible. IR plans are drilled at least annually, and are updated within an risk-informed time frame following the lessons learned portion of any exercise or drill.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Inability to quickly and effectively contain, mitigate, and communicate about cybersecurity incidents.</p>', [Sequence]=19, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9911
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:R', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.IP-4</p><div class="cpg-header">Scope</div><p>IT and OT assets necessary for business operations</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">All systems that are necessary for operations are regularly backed up on a regular cadence (no less than once per year).  <br><br>Backups are stored separately from the source systems and tested on a recurring basis, no less than once per year. Stored information for OT assets includes at a minimum: configurations, roles, PLC logic, engineering drawings and tools.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Data Destruction (T1485, ICS T0809)</li><li>Data Encrypted for Impact (T1486)</li><li>Disk Wipe (T1561)</li><li>Inhibit System Recovery (T1490)</li><li>Denial of Control (ICS T0813)</li><li>Denial/Loss of View (ICS T0815, T0829)</li><li>Loss of Availability (T0826)</li><li>Loss/Manipulation of Control (T0828, T0831)</li></ul><p></p>', [Sequence]=18, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9912
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:P', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.IP-1</p><div class="cpg-header">Scope</div><p>All IT and OT networks</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations maintain accurate documentation describing updated network topology and relevant information across all IT and OT networks. Periodic reviews and updates should be performed and tracked on a recurring basis.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Incomplete or inaccurate understanding of network topology inhibits effective incident response and recovery.</p>', [Sequence]=16, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9913
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:K', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.AC-5, PR.PT-4, DE.CM-1</p><div class="cpg-header">Scope</div><p>IT and OT assets, where safe and technically capable</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">All connections to the OT network are denied by default unless explicitly allowed (e.g. by IP address and port) for specific system functionality. Necessary communications paths between the IT and OT networks must pass through an intermediary, such as a properly configured firewall, bastion host, &#34;jump box,&#34; or a demilitarized zone (DMZ), which is closely monitored, captures network logs, and only allows connections from approved assets.</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Network Service Discovery (T1046)</li><li>Trusted Relationship (T1199)</li><li>Network Connection Enumeration (ICS T0840)</li><li>Network Sniffing (T1040, ICS T0842)</li></ul><p></p>', [Sequence]=11, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9914
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'3:A', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">ID.RA-3, DE.CM-1</p><div class="cpg-header">Scope</div><p>N/A</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">Organizations have documented a list of threats and adversary TTPs relevant to their organization (for example, based on industry, sectors, etc.), and have the ability (such as via rules, alerting, or commercial prevention and detection systems) to detect instances of those key threats.</p><div class="cpg-header">TTP or Risk Addressed</div><p class="cpg-ttp">Without the knowledge of relevant threats and ability to detect them, organizations risk adversaries existing in their networks undetected for long periods.</p>', [Sequence]=1, [Grouping_Id]=202 WHERE [Mat_Question_Id] = 9915
UPDATE [dbo].[MATURITY_QUESTIONS] SET [Question_Title]=N'2:E', [Supplemental_Info]=N'<div class="cpg-header">CSF Reference</div><p class="cpg-csf">PR.DS-1, PR.DS-2, PR.DS-5</p><div class="cpg-header">Scope</div><p>All organizational email infrastructure</p><div class="cpg-header">Recommended Action</div><p class="cpg-recommended">On all corporate email infrastructure (1) STARTTLS is enabled, (2) SPF and DKIM are enabled, and (3) DMARC is enabled and set to &#34;reject.&#34; For further examples and information, see CISA&#8217;s past guidance for Federal Agencies at : https://www.cisa.gov/binding-operational-directive-18-01</p><div class="cpg-header">TTP or Risk Addressed</div><ul><li>Phishing (T1566)</li><li>Business Email Compromise</li></ul><p></p>', [Sequence]=5, [Grouping_Id]=201 WHERE [Mat_Question_Id] = 9916
