INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (2473, 31, N'SP800-53_R3_errata_05-01-2010.pdf', N'Recommended Security Controls for Federal Information Systems and Organizations', N'NIST SP800-53 R3', 1277091, N'NIST SP800-53 R3', N'Includes destinations', NULL, N'NIST SP800-53 Rev 3 - Security Controls', NULL, N'Revision 3', N'The purpose of this publication is to provide guidelines for selecting and specifying security controls for information systems supporting the executive agencies of the federal government.  The guidelines apply to all components of an information system that process, store, or transmit federal information.  The guidelines have been developed to help achieve more secure information systems and effective risk management within the federal government.', NULL, NULL, 0)
