INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4983, 31, N'NIST.SP.800-53r5.pdf', N'Security and Privacy Controls for Information Systems and Organizations', N'NIST Special Publication 800-53 Revision 5', 6023411, N'NONE', NULL, N'This publication provides a catalog of security and privacy controls for information systems and organizations to protect organizational operations and assets, individuals, other organizations, and the Nation from a diverse set of threats and risks, ', N'SP 800-53 R5', NULL, NULL, N'This publication provides a catalog of security and privacy controls for information systems and organizations to protect organizational operations and assets, individuals, other organizations, and the Nation from a diverse set of threats and risks, including hostile attacks, human errors, natural disasters, structural failures, foreign intelligence entities, and privacy risks. The controls are flexible and customizable and implemented as part of an organization-wide process to manage risk. The controls address diverse requirements derived from mission and business needs, laws, executive orders, directives, regulations, policies, standards, and guidelines. Finally, the consolidated control catalog addresses security and privacy from a functionality perspective (i.e., the strength of functions and mechanisms provided by the controls) and from an assurance perspective (i.e., the measure of confidence in the security or privacy capability provided by the controls). Addressing functionality and assurance helps to ensure that information technology products and the systems that rely on those products are sufficiently trustworthy.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4984, 31, N'a130trans4.pdf', N'Office of Management and Budget Memorandum Circular A-130, Managing Information as a Strategic Resource', N'Office of Management and Budget A-130', 550093, N'NONE', NULL, N'This Circular establishes general policy for the planning, budgeting, governance, acquisition, and management of Federal information, personnel, equipment, funds, IT resources and supporting infrastructure and services', N'OMB A-130', NULL, NULL, N'This Circular establishes general policy for the planning, budgeting, governance, acquisition, and management of Federal information, personnel, equipment, funds, IT resources and supporting infrastructure and services. The appendices to this Circular also include responsibilities for protecting Federal information resources and managing personally identifiable information (PII). While it is the responsibility of all agency leadership, program managers, and staff to implement the requirements of this Circular, agency heads have ultimate responsibility for ensuring that the requirements of this Circular are implemented for their agency.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4989, 31, N'NIST.IR.7874.pd.pdf', N'NISTIR 7874 Guidelines for Access Control System Evaluation Metrics', N'NISTIR 7874', 498238, N'NONE', NULL, N'The purpose of this document is to provide Federal agencies with background information on access control (AC) properties.', N'NISTIR 7874', NULL, NULL, N'The purpose of this document is to provide Federal agencies with background information on access control (AC) properties, and to help access control experts improve their evaluation of the highest security AC systems. This document discusses the administration, enforcement, performance, and support properties of AC mechanisms that are embedded in each AC system. (Even though this document covers most of the essential AC properties, the listed properties are not necessarily complete.)', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4990, 31, N'NIST.SP.800-162.pd.pdf', N'NIST Special Publication 800-162 Guide to Attribute Based Access Control (ABAC) Definition and Considerations', N'NIST SP 800-162', 1863313, N'NONE', NULL, N'The purpose of this document is to provide Federal agencies with a definition of Attribute Based Access Control (ABAC) and provide considerations for using ABAC to improve information sharing while maintaining control of that information.', N'SP 800-162', NULL, NULL, N'The purpose of this document is to provide Federal agencies with a definition of Attribute Based Access Control (ABAC) and provide considerations for using ABAC to improve information sharing while maintaining control of that information. This document describes the functional components of ABAC, as well as a set of issues for employing ABAC within a large enterprise without directly addressing authentication mechanisms or all aspects of Identity Management1, thus assuming subjects are bound to trusted identities or identity providers. The focus is on core ABAC concepts without addressing in detail topics such as Attribute Engineering/Management, Integration with Identity Management, Federation, Situational Awareness (Real Time or Contextual) Mechanism, Policy Management, and Natural Language Policy translation to Digital Policy. The discussed considerations should not be deemed comprehensive. Before selecting and deploying an ABAC product or technology, the hosting organization should augment these considerations with testing and independent product reviews.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4993, 31, N'SP800-57.pdf', N'NIST SP 800-57-1 Recommendation for Key Management', N'NIST Special Publication 800-57 Part 1 Revision 5: Recommendation for Key Management: Part 1- General', 1688080, N'NONE', NULL, N'This Recommendation (i.e., SP 800-57) provides background information and establishes frameworks to support appropriate decisions when selecting and using cryptographic mechanisms.', N'SP 800-57-1', NULL, NULL, N'Organizations and developers are presented with many new choices in their use of cryptographic mechanisms. Inappropriate choices may result in an illusion of security but little or no real security for the protocol or application. This Recommendation (i.e., SP 800-57) provides background information and establishes frameworks to support appropriate decisions when selecting and using cryptographic mechanisms.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4994, 31, N'SP800-57-Part2 Encryption Management.pdf', N'NIST SP 800-57-2 Recommendation for Key Management', N'NIST Special Publication 800-57 Part 2 Revision 1: Recommendation for Key Management: Part 2- Best Practices for Key Management Organizations', 1192254, N'NONE', NULL, N'This publication is intended to acquaint system owners and managers of organizations implementing and using cryptography with the requirements that must be satisfied when cryptography is implemented in their organizations.', N'SP 800-57-2', NULL, NULL, N'This publication (hereafter referred to as Part 2) 1) identifies concepts, functions, and elements that should be common to cryptographic key management systems (CKMS); 2) identifies the security planning requirements and documentation necessary to effective organizational key management; and 3) describes cryptographic Key Management Policy and practice documentation and Key Management Specifications that are needed by organizations that use cryptography. Although there are distinctions between symmetric and asymmetric key management requirements, there is an extensive set of management principles and organizational requirements that are common to both. This publication presents common key management requirements and identifies distinct symmetric algorithm-specific and asymmetric algorithm-specific requirements, when appropriate. This publication also makes recommendations to enterprise organizations for the management of cryptographic keys, the management of metadata associated with those keys (e.g., identifying information associated with the owners of keys, the lengths of keys, and acceptable uses for those keys), and the maintenance of associations between metadata and keys.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4995, 31, N'NIST.SP.800-57-3.pdf', N'NIST SP 800-57-3 Recommendation for Key Management', N'NIST Special Publication 800-57 Part 3 Revision 1: Recommendation for Key Management: Part 3- Application-Specific Key Management Guidance', 735284, N'NONE', NULL, N'Part 3 is intended primarily to help system administrators and system installers adequately secure applications based on product availability and organizational needs and to support organizational decisions about future procurements.', N'SP 800-57-3', NULL, NULL, N'Application-Specific Key Management Guidance, Part 3 of the Recommendation for Key Management is intended primarily to help system administrators and system installers adequately secure applications based on product availability and organizational needs and to support organizational decisions about future procurements. This document also provides information for end users regarding application options left under their control in normal use of the application.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (4997, 31, N'NIST.SP.800-178.pd.pdf', N'NIST SP 800-178 A Comparison of Attribute Based Access Control (ABAC) Standards for Data Service Applications', N'NIST Special Publication 800-178: A Comparison of Attribute Based Access Control (ABAC) Standards for Data Service Applications: Extensible Access Control Markup Language (XACML) and Next Generation Access Control (NGAC)', 1540904, N'NONE', NULL, N'The document explains the basics of both standards and provides a comparative analysis based on attribute based access control (ABAC) considerations identified in NIST Special Publication (SP) 800-162.', N'SP 800-178', NULL, NULL, N'The purpose of this document is to compare and contrast Extensible Access Control Markup Language (XACML) and Next Generation Access Control (NGAC) — two very different access control standards with similar goals and objectives. The document explains the basics of both standards and provides a comparative analysis based on attribute based access control (ABAC) considerations identified in NIST Special Publication (SP) 800-162, Guide to Attribute Based Access Control (ABAC) Definition and Considerations [2].', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5004, 31, N'SP800-113.pdf', N'NIST SP 800-113: Guide to SSL VPNs', N'NIST Special Publication 800-113: Guide to SSL VPNs', 2148970, N'NONE', NULL, N'This publication discusses the fundamental technologies and features of SSL VPNs.', N'SP 800-113', NULL, NULL, N'This publication discusses the fundamental technologies and features of SSL VPNs. It describes SSL and how it fits within the context of layered network security. It presents a phased approach to SSL VPN planning and implementation that can help in achieving successful SSL VPN deployments. It also compares the SSL VPN technology with IPsec VPNs and other VPN solutions. This information is particularly valuable for helping organizations to determine how best to deploy SSL VPNs within their specific network environments.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5008, 31, N'SP800-50.pdf', N'NIST SP 800-50 Building an Information Technology Security Awareness and Training Program', N'NIST Special Publication 800-50 Building an Information Technology Security Awareness and Training Program', 4065963, N'NONE', NULL, N'This document provides guidelines for building and maintaining a comprehensive awareness and training program, as part of an organization’s IT security program.', N'SP 800-50', NULL, NULL, N'NIST Special Publication 800-50, Building An Information Technology Security Awareness and Training Program, provides guidance for building an effective information technology (IT) security program and supports requirements specified in the Federal Information Security Management Act (FISMA) of 2002 and the Office of Management and Budget (OMB) Circular A-130, Appendix III. A strong IT security program cannot be put in place without significant attention given to training agency IT users on security policy, procedures, and techniques, as well as the various management, operational, and technical controls necessary and available to secure IT resources. In addition, those in the agency who manage the IT infrastructure need to have the necessary skills to carry out their assigned duties effectively. Failure to give attention to the area of security training puts an enterprise at great risk because security of agency resources is as much a human issue as it is a technology issue.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5011, 31, N'SP800-92.pdf', N'NIST SP 800-92: Guide to Computer Security Log Management', N'NIST Special Publication 800-92: Guide to Computer Security Log Management', 5844139, N'NONE', NULL, N'This publication seeks to assist organizations in understanding the need for sound computer security log management.', N'SP 800-92', NULL, NULL, N'This publication seeks to assist organizations in understanding the need for sound computer security log management. It provides practical, real-world guidance on developing, implementing, and maintaining effective log management practices throughout an enterprise. The guidance in this publication covers several topics, including establishing log management infrastructures, and developing and performing robust log management processes throughout an organization. The publication presents log management technologies from a high-level viewpoint, and it is not a step-by-step guide to implementing or using log management technologies.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5021, 31, N'SP800-34-rev1.pdf', N'NIST SP 800-34 R1: Contingency Planning Guide for Federal Information Systems', N'NIST Special Publication 800-34 Revision 1: Contingency Planning Guide for Federal Information Systems', 1109567, N'NIST SP 800-34 R1', NULL, N'NIST Special Publication 800-34, Rev. 1, Contingency Planning Guide for Federal Information Systems, provides instructions, recommendations, and considerations for federal information system contingency planning.', N'SP 800-34 R1', NULL, NULL, N'NIST Special Publication 800-34, Rev. 1, Contingency Planning Guide for Federal Information Systems, provides instructions, recommendations, and considerations for federal information system contingency planning. Contingency planning refers to interim measures to recover information system services after a disruption. Interim measures may include relocation of information systems and operations to an alternate site, recovery of information system functions using alternate equipment, or performance of information system functions using manual methods. This guide addresses specific contingency planning recommendations for three platform types and provides strategies and techniques common to all systems.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5023, 31, N'SP800-84.pdf', N'NIST SP 800-84: Guide to Test, Training, and Exercise Programs for IT Plans and Capabilities', N'NIST Special Publication 800-84: Guide to Test, Training, and Exercise Programs for IT Plans and Capabilities', 592717, N'NONE', NULL, N'This publication seeks to assist organizations in designing, developing, conducting, and evaluating TT&E events in an effort to aid personnel in preparing for adverse situations involving IT.', N'SP 800-84', NULL, NULL, N'This publication seeks to assist organizations in designing, developing, conducting, and evaluating TT&E events in an effort to aid personnel in preparing for adverse situations involving IT. The events are designed to train personnel, exercise IT plans, and test IT systems, so that an organization can maximize
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5038, 31, N'SP800-111.pdf', N'NIST SP 800-111: Guide to Storage Encryption Technologies for End User Devices', N'NIST Special Publication 800-111: Guide to Storage Encryption Technologies for End User Devices', 363231, N'NONE', NULL, N'The purpose of this document is to assist organizations in understanding storage encryption technologies for end user devices and in planning, implementing, and maintaining storage encryption solutions.', N'SP 800-111', NULL, NULL, N'The purpose of this document is to assist organizations in understanding storage encryption technologies for end user devices and in planning, implementing, and maintaining storage encryption solutions. The types of end user devices addressed in this document are personal computers (desktops and laptops), consumer devices (e.g., personal digital assistants, smart phones), and removable storage media (e.g., USB flash drives, memory cards, external hard drives, writeable CDs and DVDs). This document provides practical, real-world guidance for three classes of storage encryption techniques: full disk encryption, volume and virtual disk encryption, and file/folder encryption. It also discusses important security elements of a storage encryption deployment, including cryptographic key management and
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5043, 31, N'SP800-60_Vol2-Rev1.pdf', N'NIST SP 800-60-2 R1: Volume II: Appendices to Guide for Mapping Types of Information and Information Systems to Security Categories', N'NIST Special Publication 800-60-2 Revision 1: Volume II: Appendices to Guide for Mapping Types of Information and Information Systems to Security Categories', 1094170, N'NONE', NULL, N'Volume II include security categorization recommendations and rationale for mission-based and management and support information types.', N'SP 800-60-2', NULL, NULL, N'Volume II include security categorization recommendations and rationale for mission-based and management and support information types.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5045, 31, N'SP800-55-rev1.pdf', N'NIST SP 800-55 R1: Performance Measurement Guide for Information Security', N'NIST Special Publication 800-55 Revision 1: Performance Measurement Guide for Information Security', 1950307, N'NONE', NULL, N'This document is a guide for the specific development, selection, and implementation of information system-level and program-level measures to indicate the implementation, efficiency/effectiveness, and impact of security controls, and other security-', N'SP 800-55 R1', NULL, NULL, N'This document is a guide for the specific development, selection, and implementation of information system-level and program-level measures to indicate the implementation, efficiency/effectiveness, and impact of security controls, and other security-related activities.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5047, 31, N'NIST.SP.800-161.pdf', N'NIST SP 800-161: Supply Chain Risk Management Practices for Federal Information Systems and Organizations', N'NIST Special Publication 800-161: Supply Chain Risk Management Practices for Federal Information Systems and Organizations', 3129678, N'NONE', NULL, N'The purpose of this publication is to provide guidance to federal agencies on identifying, assessing, selecting, and implementing risk management processes and mitigating controls throughout their organizations to help manage ICT supply chain risks.', N'SP 800-161', NULL, NULL, N'The purpose of this publication is to provide guidance to federal agencies on identifying, assessing, selecting, and implementing risk management processes and mitigating controls throughout their organizations to help manage ICT supply chain risks.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (5055, 31, N'SP800-35.pdf', N'NIST SP 800-35: Guide to Information Technology Security Services', N'NIST SP 800-35: Guide to Information Technology Security Services', 3784834, N'NONE', NULL, N'The purpose of this guide is to provide assistance with selecting, implementing, and managing IT security services by guiding the organization through the various phases of the IT security services life cycle.', N'SP 800-35', NULL, NULL, N'The purpose of this guide is to provide assistance with selecting, implementing, and managing IT security services by guiding the organization through the various phases of the IT security services life cycle. The IT security services life cycle provides a framework that enables the IT security decision makers to organize their IT security efforts—from initiation to closeout. The systematic management of the IT security services process is critically important. Failure to consider and manage the many complex issues involved can seriously impact the organization. IT security decision makers must think about the costs and security requirements, as well as organizational mission and strategic functions, personnel and service provider arrangements.', NULL, NULL, 0)
INSERT INTO [dbo].[GEN_FILE] ([Gen_File_Id], [File_Type_Id], [File_Name], [Title], [Name], [File_Size], [Doc_Num], [Comments], [Description], [Short_Name], [Publish_Date], [Doc_Version], [Summary], [Source_Type], [Data], [Is_Uploaded]) VALUES (6098, 31, N'ffiec_itbooklet_businesscontinuitymanagement_v3.pdf', N'FFIEC Information Technology Examination Handbook', N'Business Continuity Management', 1247087, N'NONE', NULL, NULL, N'FFIEC-BCM', NULL, NULL, N'The “Business Continuity Management” (BCM) booklet is one in a series of booklets that comprise the Federal Financial Institutions Examination Council (FFIEC) Information Technology Examination Handbook (IT Handbook). The IT Handbook is prepared for use by examiners. With the publication of this booklet, the FFIEC member agencies replace the “Business Continuity Planning” booklet issued in February 2015. The change from business continuity planning to business continuity management reflects the changes in customer and industry expectations for the resilience of operations. The BCM booklet describes principles and practices for IT and operations for safety and soundness, consumer financial protection, and compliance with applicable laws and regulations. The BCM booklet also outlines BCM principles to help examiners evaluate how management addresses risk related to the availability of critical financial products and services. This booklet discusses BCM governance and its related components, including resilience strategies and plan development; training and awareness; exercises and tests; maintenance and improvement; and reporting for all levels of management, including the board of directors. The focus of this revised booklet is on enterprise-wide, process-oriented approaches that consider technology, business operations, testing, and communication strategies critical to the continuity of the entire entity. However, business continuity should not be focused only on the planning process to recover operations after an event, but rather it should include the continued maintenance of systems and controls for the resilience of operations. Business continuity should be incorporated into the risk management life cycle of all systems, processes, and operations of an entity.  For IT Handbook purposes, the term “entities” includes depository financial institutions, nonbank financial institutions, bank holding companies, and third-party service providers.', NULL, NULL, 0)
